    private async Task OnFinish(EditContext editContext)
    {
        if (IsInsert)
        {
            result = await CostService.InsertCostAsync(CostModel);
        }
        else
        {

            result = await CostService.UpdateCostAsync(CostModel);
        }
        if (result.Status == ActionStatus.OK)
